import React from 'react'
import { useHistory } from 'react-router'

function Logout() {
    let history = useHistory()
    const logout = () =>{
        localStorage.removeItem('JWTtoken')
        history.push('/')
    }
    return (
        <div>
            <button onClick={logout}>Logout</button>
        </div>
    )
}

export default Logout
